import logo from './logo.svg';
import './App.css';
import SearchBar from './components/search'
import React from "react"; 
import { colors } from '@mui/material';

function App() {
  return (
    <div className="App">
      <div className="HeaderStyle">
          <img src="planetImage.png" width="200" height="200"/>
          <h1 style={{color: "white" , margin: "60px"}}>Country Search</h1>
          <img src="roadMapBackGround.webp" width="90000" height="200"/>
      </div>
      <header className="App-header">
        <SearchBar/>
      </header>
      <div className="App-body">
      </div>
    </div>
  );
}
export default App;
